import React from 'react';
import PropTypes from 'prop-types';

const ImagePort = (props) => (
    <img  
        src={props.src}
        width = {props.width}
        height = {props.height}  
    />
);

ImagePort.defaultProps = {
  width: '100%',
  height: '100%',
isScalable : false
};
